  const handleChange = (e) => {
    setValue(e.target.value)
  }

  return (
  <div className="reservations-container">
  <form>
    <input 
    value={value}
    onChange={handleChange}
    type="text"
     />
     <div>
      <label>Comment:</label>
      <textArea />
     </div>
  </form>
  </div>
  )
}

export default Reservations;
